import React from "react";

const Mapa = () =>{
    return(
        <div>
            <div id="map"></div>
	        <h1>Mouse over a cluster to see the bounds of its children and click a cluster to zoom to those bounds</h1>
        </div>
    );
}

export default Mapa;
